var usage = {};

for (var i=0; i<rawUsage.length; i++) {
	var url = rawUsage[i][0];
	var seconds = rawUsage[i][1];
	var subject = url.substring(33, url.indexOf("/", 34));

 	// make new subject if needed
	if (!usage[subject]) {
	  usage[subject] = {
		  videoUsage: 0,
		  videos: [],
		  exerciseUsage: 0,
		  exercises: [],
		  articleUsage: 0,
		  articles: []
	  };
	}

	// update net usage per type
	var type = "";

	if (url.indexOf("/e/") != -1) {
	  type = "exercises";
	  usage[subject].exerciseUsage += seconds;
	} else if (url.indexOf("/a/") != -1) {
	  type = "articles";
	  usage[subject].articleUsage += seconds;
	} else {
	  type = "videos";
	  usage[subject].videoUsage += seconds;
	}

	// add to array
	usage[subject][type].push({'url': url, 'time': seconds});
}